import React from "react";

export default class Product extends React.Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <div className="cards">
        <div>
          <img src="1.jpg" alt="Image will be loaded" />
        </div>
        <h3>{this.props.name}</h3>
        <p>{this.props.detail}</p>
      </div>
    );
  }
}
